import React, { Fragment } from "react";
import styled from "styled-components";

const Wrapper = styled.section`
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
	text-align: center;
	font-family: "Quicksand";
`;

const WrapperTitle = styled.div`
	margin-top: 25px;
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
	text-align: center;
`;

const Title = styled.h1`
	font-size: 15px;
`;

const WrapperGifts = styled.div`
	color: blue;
	font-size: 16px;
`;

const Wrappergift = styled.div`
	height: auto;
	width: 100vw;
`;

const GiftTitle = styled.h2`
	height: auto;
	width: 100vw;
`;

const ColorLine = styled.button`
	height: auto;
	width: 100vw;
`;

const image = "images/footer.png";

const Home = () => {
	return (
		<Fragment>
			<Wrapper>
				<WrapperTitle>
					<Title></Title>
				</WrapperTitle>
				<WrapperGifts>
					<Wrappergift>
						<GiftTitle></GiftTitle>
						<ColorLine></ColorLine>
					</Wrappergift>
					<Wrappergift>
						<GiftTitle></GiftTitle>
						<ColorLine></ColorLine>
					</Wrappergift>
				</WrapperGifts>
			</Wrapper>
		</Fragment>
	);
};

export default Home;
